import logo from './logo.svg';
import './App.css';
import React, { useState, useEffect } from "react";

function App() {
  const [branches, setBranches] = useState("");

  useEffect(() => {
    fetch("http://localhost:8000/branches")
      .then((res) => res.json())
      .then((data) => 
        {
          setBranches(
            <select name="branches">
                data.map((branch) => (
                  <option value="{branch.BranhNum}">{branch.BranchName}</option>
                  ))

            </select>
          );
        }
      );
  }, []);

  return (
    <div className="App">
      <header className="App-header">
      <h1>Video4Ever Branch Inventory</h1>
        <p>
         Choose a branch to view the branch inventory.
        </p>
        {branches}
      </header>
    </div>
  );
}

export default App;
